import React from "react";
import { Header, Carousel } from "../components/mollecules";
import { Button, Cards, Text } from "../components/atomes";
import { Discover } from "../components/organismes";

const produitVinRouge = require("../assets/produitVinRouge.png");
const produitVinBlanc = require("../assets/produitVinBlanc.png");
const produitChampagne = require("../assets/produitChampagne.png");

function Home() {
  return (
    <div>
      <Header.laptopHeader />
      <Carousel.Carousel />
      <Discover.Discover />
      <div className="px-28">
        <div className="flex flex-row items-center mb-8">
          <div>
            <Text.h4>Nouveautés</Text.h4>
          </div>
          <div className="w-full h-[2px] bg-gray-300 mx-6"></div>
        </div>
        <div className="flex flex-row mb-6">
          <Cards.Produit
            bg={produitVinRouge}
            color={"#5C221E"}
            typeColor={"#5C221E"}
            type={"Rouge"}
            name={"Vin Rouge Corvo"}
            pays={"Italie"}
            oldPrice={"16.80€"}
            price={"13.80€"}
          />
          <Cards.Produit
            bg={produitVinBlanc}
            color={"#FFECB3"}
            typeColor={"#FFECB3"}
            type={"Blanc"}
            name={"Vin BlancGrigio"}
            pays={"Italie"}
            oldPrice={"29.99€"}
            price={"24.99€"}
          />
          <Cards.Produit
            bg={produitChampagne}
            color={"#D0943A"}
            typeColor={"#D0943A"}
            type={"Champagne"}
            name={"ChampagnePinot"}
            pays={"France"}
            oldPrice={"29.90€"}
            price={"27.90€"}
          />
        </div>
      </div>
      <header className="w-full h-20 bg-[#212121] flex flex-row justify-around items-center">
        <div className="mr-14">
          <img src={logo} alt="Logo de l'entreprise" width={100} height={100} />
        </div>
        <div className="flex flex-row items-center">
          <div className="mr-3 cursor-pointer">
            <Text.p fontSize={18} color="#fff">
              Accueil
            </Text.p>
          </div>
          <div className="cursor-pointer">
            <Text.p color="#fff" fontSize={18}>
              Boutique
            </Text.p>
          </div>
        </div>
        <div className="flex flex-row items-center">
          <div className="mr-10 cursor-pointer">
            <Button.Primary value={"Se Connecter"} />
          </div>
          <div className="mr-3 cursor-pointer">
            <FaUserCircle size={28} color="#EEEEEE" />
          </div>
          <div className="cursor-pointer">
            <FaShoppingCart size={28} color="#EEEEEE" />
          </div>
        </div>
      </header>
    </div>
  );
}

export default Home;
